                        global_delivery_collectibles_disclaimer: "The wallet displayed here will be the one that receives the Digital Collectible. You can update it anytime in the \\\"My Wallet\\\" section of your MyLV account. For legal purposes, you will also be asked to provide your shipping address.",
                        global_delivery_collectibles_title: "Wallet delivery",
                        global_delivery_date: "\u003C\u002Fbr\u003EPlease bring the following items in order to pickup your order: Photo ID, the Credit Card used to place the order, and confirmation email. Estimated delivery date: ",
                        global_delivery_panel: cL,
                        global_delivery_returns_panel: "Delivery & returns",
                        global_digital_collectibles_frequent_question_answer_1: "This tab is a dedicated space for the Louis Vuitton VIA community. Here you can connect the wallet that holds your VIA digital collectibles, visualise your VIA collection, and perform some actions on your collectibles like claiming the physical twins associated (when available).",
                        global_digital_collectibles_frequent_question_answer_2: "Louis Vuitton doesn’t track the activity of your wallet in real-time; we retrieve the information of your wallet at the time you connect it. This is why we ask you to connect your wallet each time you browse in this tab, so we can display the most up-to-date information around your VIA collectibles.",
                        global_digital_collectibles_frequent_question_answer_3: "First, please ensure you connect the wallet that holds your VIA collectibles. Please note that if you transferred one (or several) of your VIA collectibles to another wallet of yours, or resold it to someone else, they won’t be displayed anymore in your wallet and therefore in this tab either. If you still encounter an issue, please contact us for assistance.",
                        global_digital_collectibles_frequent_question_answer_4: "Owning a VIA digital collectible entitles you to claim its physical twin. If the button “Claim my physical twin” appears under your collectible, it means that you can already let us know that you wish to get the physical twin.  \nBy clicking on this button, you will first access a form on which you will be able to enter your delivery preferences.  \nYou will then have to confirm the action with your wallet provider by signing a message. The signature process is very easy; you will just have to read a message that will appear on your wallet app \u002F browser extension and click on a button to confirm. Once it’s done, your claim request will be registered, and you will be contacted shortly by an Advisor to arrange the details of your delivery. ",
                        global_digital_collectibles_frequent_question_answer_5: "The wallet ID provided here will only be used to deliver the Digital Collectible. You can update or disconnect it anytime on this page.",
                        global_digital_collectibles_frequent_question_question_1: "What is the purpose of this “My VIA” tab?",
