                        myLV_certificates_legal_mentions_description: "The Digital Certificate is issued at the time of sale and is the expression of the interpretation of the gemological knowledge of the international laboratories and the technical means made available to them at the time of the analyses.\u003Cbr\u003EThe Digital Certificate establishes an opinion on the authenticity of the gems to date but does not reflect the expression of an expertise of value and beauty.\u003Cbr\u003ELouis Vuitton cannot vouch for and be held responsible for the evolution of knowledge or a change in interpretation of any laboratory in the future.\u003Cbr\u003EThe traceability information of the stone is based on the declarations made by our suppliers.\u003Cbr\u003EExcept for the image of your own rough, all the other images displayed in the Digital Certificate are merely representative and not specific to your stone.\u003Cbr\u003ENot all diamond product models of Louis Vuitton have an associated Digital Certificate assigned to them. [Comments: Please confirm if it is the case.]\u003Cbr\u003EThe Digital Certificate is stored on a private blockchain (Aura Blockchain Consortium’s private platform). You do not need to hold a cryptowallet to retrieve it, as it is accessible only through your MyLV account.\u003Cbr\u003EIn order to retrieve your Digital Certificate, you will therefore need to link it to your MyLV account. After it is linked to a specific MyLV account, the Digital Certificate can be transferred by its initial holder to subsequent holder of the underlying diamond product through Louis Vuitton’s Apps, websites or other online platforms specified by Louis Vuitton from time to time. \u003Cbr\u003EThe Digital Certificate cannot be deemed a proof of ownership or proof of authenticity of the underlying diamond product. \u003Cbr\u003EIn case of exchange or return of the diamond product with Louis Vuitton, Louis Vuitton will automatically retrieve back its associated Digital Certificate, which will no longer appear on your account. \u003Cbr\u003ELouis Vuitton may amend these terms and conditions from time to time.",
