                        tryon_consent_poppin_message: "To enjoy the virtual try-on (VTO) experience, you hereby agree to give access to your camera. Your image is processed live, for the sole purpose and for the sole duration of your VTO experience, and is not retained or stored by Louis Vuitton or third parties. The image is also not used by Louis Vuitton or its partners for unrelated purposes. You may visit our \u003Ca href=\"https:\u002F\u002Fin.louisvuitton.com\u002Feng-in\u002Flegal-privacy\"\u003EPrivacy Policy\u003C\u002Fa\u003E for additional information about our data protection practices. ",
                        tryon_consent_poppin_message_bracelets: "\t\nTo enjoy the virtual try-on (VTO) experience, you hereby agree to give access to your camera. Your image is processed live, for the sole purpose and for the sole duration of your VTO experience, and is not retained or stored by Louis Vuitton or third parties. The image is also not used by Louis Vuitton or its partners for unrelated purposes. You may visit our Privacy Policy for additional information about our data protection practices.",
                        tryon_consent_poppin_message_earrings: b,
                        tryon_consent_poppin_message_rings: "The virtual try-on technology (“VTOT”) you are considering using collects data from your photograph so it may virtually “place” the item where it belongs on that photograph (the “Data”).  Louis Vuitton North America, Inc. (including its related entities) (“LV”) does not believe the Data constitutes “biometric identifiers” or “biometric information” under the Illinois Biometric Information Privacy Act (“BIPA”), the Texas Capture or Use of Biometric Identifier Act (“CUBI”), or Washington’s biometric privacy law known as H.B. 1493 or Revised Code of Washington Section 19.375.020 (“Washington Biometrics Law”). Nevertheless, LV provides the following information.  By using the VTOT, you agree to the terms set forth below (the “Policy”).\n\nCollection of the Data.  All Data is collected directly from your photograph by Perfect Mobile Corp. through its proprietary software.  LV does not collect, possess, use, or have access to any Data. The Data is collected for the purpose of assisting you in viewing how certain products may look on the photograph provided.\n\nDestruction of the Data. Perfect Mobile Corp. shall destroy any Data within six (6) months of your last use of the VTOT. \n\nConsent and Agreement.  You acknowledge that by agreeing to use the VTOT, you are giving your written consent to the collection of the Data, even if such Data were construed to constitute biometric identifiers or biometric information under BIPA, CUBI, or the Washington Biometrics Law.\n\nJury and Class Action Waivers.  You, LV, and PERFECT MOBILE CORP. agree that in the event of any dispute relating to BIPA, CUBI, THE WASHINGTON BIOMETRICS LAW, OR THE DATA, all parties waive their right to trial by jury.  You, LV, and PERFECT MOBILE CORP. FURTHER agree to litigate any dispute amongst the parties relating to BIPA, CUBI, THE WASHINGTON BIOMETRICS LAW, OR THE DATA on an individual basis and not as part of a class action.\n\nForum Selection Clause.  You, LV, and Perfect Mobile Corp. agree hereby submit to the exclusive jurisdiction of the courts sitting in or for New York, New York and agree that venue is proper therein (and waive any objection to such venue) for any dispute arising out of or relating to this Policy, including but not limited to any dispute relating to BIPA, CUBI, or the Washington Biometrics Law. ",
